text:
As cars become increasingly connected, we must ensure we’re keeping up with the technology to protect survivors from those who take advantage of it as a tool of abuse and control. 
 
@RepDanCrenshaw and I introduced a bill to allow domestic violence survivors to disable connected vehicle services from their abuser. 
 
https://t.co/LICKYItDiV

As the D.C. Car Show is coming to an end, I asked some of my colleagues to share their favorite car stories!

